@prefix co: <https://example.com/ont_wrmp#> .
@prefix dcterms: <http://purl.org/dc/terms/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix schema: <https://schema.org/> .

co:AdaptivePlanning a rdfs:Class ;
    rdfs:label "Adaptive Planning" ;
    rdfs:comment "A planning approach that allows for flexibility and responsiveness to changing conditions over time." .

co:ClimateChange a rdfs:Class ;
    rdfs:label "Climate Change" ;
    rdfs:comment "Long-term changes in temperature and weather patterns, affecting water availability." .

co:EconomicConsiderations a rdfs:Class ;
    rdfs:label "Economic Considerations" ;
    rdfs:comment "Factors related to the economic implications of water resource management strategies." .

co:EnvironmentalImpact a rdfs:Class ;
    rdfs:label "Environmental Impact" ;
    rdfs:comment "The effect of water resource management activities on the environment." .

co:FutureProjections a rdfs:Class ;
    rdfs:label "Future Projections" ;
    rdfs:comment "Predictions regarding future water demand, supply, and environmental conditions." .

co:LeakageReduction a rdfs:Class ;
    rdfs:label "Leakage Reduction" ;
    rdfs:comment "Strategies and technologies implemented to minimize water loss in distribution systems." .

co:PopulationGrowth a rdfs:Class ;
    rdfs:label "Population Growth" ;
    rdfs:comment "The increase in the number of individuals in a population, impacting water demand." .

co:RegulatoryFramework a rdfs:Class ;
    rdfs:label "Regulatory Framework" ;
    rdfs:comment "The set of regulations and policies guiding water resource management practices." .

co:StakeholderEngagement a rdfs:Class ;
    rdfs:label "Stakeholder Engagement" ;
    rdfs:comment "The involvement of various stakeholders in the water resource management process." .

co:WaterDemand a rdfs:Class ;
    rdfs:label "Water Demand" ;
    rdfs:comment "The total volume of water required for various purposes by a population or sector." .

co:WaterEfficiency a rdfs:Class ;
    rdfs:label "Water Efficiency" ;
    rdfs:comment "Practices aimed at reducing water use while maintaining the same level of service." .

co:WaterManagementStrategy a rdfs:Class ;
    rdfs:label "Water Management Strategy" ;
    rdfs:comment "Specific strategies employed to manage water resources effectively, such as rainwater harvesting and aquifer recharge." .

co:WaterQuality a rdfs:Class ;
    rdfs:label "Water Quality" ;
    rdfs:comment "The chemical, physical, and biological characteristics of water, essential for health and environmental sustainability." .

co:WaterResourceManagementPlan a rdfs:Class ;
    rdfs:label "Water Resource Management Plan" ;
    rdfs:comment "A plan outlining strategies for managing water resources sustainably over a specified period." .

co:WaterReuse a rdfs:Class ;
    rdfs:label "Water Reuse" ;
    rdfs:comment "The process of treating wastewater for reuse in various applications." .

co:WaterSupply a rdfs:Class ;
    rdfs:label "Water Supply" ;
    rdfs:comment "The provision of water for various uses, including drinking, irrigation, and industrial processes." .

co:WaterTransfer a rdfs:Class ;
    rdfs:label "Water Transfer" ;
    rdfs:comment "The movement of water from one location to another to meet demand." .

<https://example.com/doc/6360e3afb669/chunk/6360e3afb669> a schema:TextDigitalDocument ;
    rdfs:label "Chunk 6360e3afb669" .

<https://example.com/ont_wrmp> a owl:Ontology ;
    rdfs:label "Water Resources Management Plan Ontology" ;
    dcterms:description "This ontology provides a comprehensive structured representation of concepts and relationships related to water resources management, focusing on sustainable water supply, environmental considerations, stakeholder engagement, economic implications, and adaptive planning strategies. It aims to facilitate data interoperability and enhance understanding of water resource challenges and solutions over the long term, while addressing future projections and regulatory frameworks.",
        "This ontology provides a structured representation of concepts and relationships related to water resources management, focusing on sustainable water supply, environmental considerations, and adaptive planning strategies. It aims to facilitate data interoperability and enhance understanding of water resource challenges and solutions over the long term." ;
    dcterms:title "wrmp" ;
    rdfs:comment "This ontology provides a comprehensive structured representation of concepts and relationships related to water resources management, focusing on sustainable water supply, environmental considerations, stakeholder engagement, economic implications, and adaptive planning strategies. It aims to facilitate data interoperability and enhance understanding of water resource challenges and solutions over the long term, while addressing future projections and regulatory frameworks.",
        "This ontology provides a structured representation of concepts and relationships related to water resources management, focusing on sustainable water supply, environmental considerations, and adaptive planning strategies. It aims to facilitate data interoperability and enhance understanding of water resource challenges and solutions over the long term." ;
    owl:versionInfo "1.0.0",
        "1.1.0" .

co:affectedByClimateChange a rdf:Property ;
    rdfs:label "affected By Climate Change" ;
    rdfs:domain co:WaterResourceManagementPlan ;
    rdfs:range co:ClimateChange .

co:affectedByPopulationGrowth a rdf:Property ;
    rdfs:label "affected By Population Growth" ;
    rdfs:domain co:WaterResourceManagementPlan ;
    rdfs:range co:PopulationGrowth .

co:engagesStakeholders a rdf:Property ;
    rdfs:label "engages Stakeholders" ;
    rdfs:domain co:WaterResourceManagementPlan ;
    rdfs:range co:StakeholderEngagement .

co:governedByRegulatoryFramework a rdf:Property ;
    rdfs:label "governed By Regulatory Framework" ;
    rdfs:domain co:WaterResourceManagementPlan ;
    rdfs:range co:RegulatoryFramework .

co:hasEconomicConsiderations a rdf:Property ;
